`;function l1(){return c.jsxs(s1,{children:[c.jsx(ae,{img:nm,alt:"foto de um leo marinho em cima de rochas de colorao amarronzada, em Paracas"}),c.jsx("h3",{children:"Paracas, Peru | 2023"}),c.jsx("p",{children:"Cinco dias no Peru. Essa era a ideia inicial. Comecei a pesquisar sobre este pas e rapidamente acrescentei mais cinco dias. E se eu pudesse, teria ficado mais. Pra quem leu sobre Guna Yala j sabe que fui com uma amiga. Com ela fui pra Cusco, onde esto os passeios mais solicitados. Machu Picchu no poderia faltar, mas escolhi falar de um destino menos conhecido."}),c.jsx("p",{children:"Em Paracas a atrao principal so as Islas Ballestas, conhecida como mini Galpagos do Peru, que fica na Reserva Nacional de Paracas. Minha gente, antes das minhas pesquisas jamais que iria imaginar que numa viagem de dez dias pelo Peru eu iria visitar stios arqueolgicos, montanhas h mais de 5 mil metros de altitude, que iria presenciar vrios lees-marinhos de perto, pinguins, encontro de deserto e mar alm de me hospedar numa vila que  basicamente um osis no meio do deserto."}),c.jsx("p",{children:"Eu j disse que viajar de trip tem a vantagem de a agncia organizar tudo pra ti, fazer a parte chata. Mas s  chata quando no temos tempo para pesquisar e organizar tudo.  maravilhoso ns mesmas montarmos nosso roteiro, do nosso jeitinho. A viagem j comea muito antes da estrada. Eu amo as trips para viagens curtas, em especial as que envolvem muitos translados, passeios. Para as minhas frias prefiro eu mesma planejar, dependendo do destino. Nunca que eu ia encontrar uma agncia/expedio que inclusse Cusco, Paracas, Huacachina, Cidade do Panam e Guna Yala na mesma viagem. S eu pra ter essas ideias, heheh. Mas se voc tiver um desejo mais fora do comum, como eu, e estiver insegura com o planejamento, h a possibilidade de contratar consultoras de viagem, elas montam seu roteiro personalizado e te do vrias dicas do destino."}),c.jsx("p",{children:"Vou resumir em ordem cronolgica essa viagem, comeando por Lima, pois j cheguei passando perrengue. Optei por j comprar um chip no aeroporto, meu carto da wise no passou Tentei algumas vezes e nada, tentei com o carto global do C6 e foi, uffa. Fui sacar dinheiro e nada, que desespero! Ainda no Brasil, vi que no precisava desbloquear nada, no sabia o que poderia ser. Bora pedir um uber. Inocente ca na conversa de um taxista dizendo que uber era do lado de fora do aeroporto. No parei por a, decidi ir com ele, com um amigo dele, na real. Ele tentou passar meu carto antes, lembro dele perguntar se era crdito e disse que seria melhor, mas optei por passar o carto que ja tinha usado. Compra no aprovada, estranhei mas no o bastante pra sair do carro. Tentei no crdito, passou. Ele pediu pra eu confirmar no celular. Estava tendo dificuldades com o app e quase deixando pra l qdo achei a compra, o cara me cobrou dez vezes a mais Por isso o primeiro carto no passou, no tinha saldo suficiente. Ele ia estornar, pediu a senha de novo, o que eu fao?. Digitei a senha, esperei atualizar no app e sai do carro dele. Ele ainda veio falar que o valor combinado da corrida (mesmo valor do uber) era em dlar e no em soles (moeda peruana e com cmbio prximo ao real). Eu disse que no e fui pedir meu uber. Bloqueei meu carto, no Brasil pedi outro. Pq ele pediu pra eu conferir, eu no sei. Talvez fosse pra eu aceitar ir pagando em dlar e sem reclamar, poderia ter me sentido mais intimidada e aceitado. Enfim, no final deu certo, conferi inmeras vezes minha fatura e no tinha nada de errado. Mas, o ocorrido afetou meu dia em Lima No hostel meu carto wise passou. Do lado tinha um restaurante, pedi uma pizza individual e double pisco sour, drink tpico do Peru. Curti minha cia no restaurante e fui dormir. Escolhi um quarto  individual no hostel pois a noite anterior passei no aeroporto. De manh segui pra Cusco, encontrei minha amiga no aeroporto de l."}),c.jsx("p",{children:"No aeroporto consegui sacar dinheiro, boa parte dos caixa eletrnicos cobram taxa, ento saquei o suficiente para os dias seguintes. Sempre que dava, pagava no carto de dbito. Eu e minha amiga optamos por agncia para os dias que passaramos em Cusco. Pesquisamos muito at achar uma que parecia confivel e com bons preos. Fizemos a escolha certa. Em um desses papos nos passeios descobrimos que uma moa pagou quase o mesmo valor que ns pagamos pra cinco dias com passeios, transfer e hospedagem, s pra ir pra Machu Picchu. E claro, no nosso pacote tbm estava includo esse passeio, indo de trem. Falam que  bem tranquilo deixar pra fechar os passeios l, exceto Machu Picchu, mas como no ia sozinha no quis pegar pra mim essa responsa de planejar tudo. Se quiserem o contato da agncia ou dicas de Cusco, s me chamar. De Cusco, fomos de avio para Lima. Passamos o dia e noite juntas, na manh seguinte eu segui sozinha para Paracas, minha amiga voltou pro Brasil."}),c.jsx("p",{children:"Os turistas que no vo apenas pra Cusco costumam iniciar sua viagem por Paracas e depois seguir por mais cidades at chegar em Cusco. H uma empresa que faz esse trajeto de nibus, incluindo alguns passeios. Tem sada todos os dias e voc escolhe se vai pernoitar na cidade ou no. O bacana de chegar em Cusco de nibus  que alm de conhecer vrias cidades voc tambm vai subindo de altitude aos poucos. O soroche, mal de altitude, deixou eu e minha amiga muito mal no primeiro dia em Cusco."}),c.jsx("p",{children:"Voltando a Paracas Fiz a viagem de trs dias com a empresa que citei anteriormente, me buscaram no hostel. Na primeira parada j percebi que tinham poucos latinos, diferente de Cusco. Esse foi um ponto negativo j que no falo ingls, mas poderia ter sido positivo se eu estivesse disposta a treinar meu ingls ruim, kkkk. Confesso que eu no esperava por isso, mas tanto em Paracas como em Huacachina eu encontrei poucas pessoas que falavam espanhol como primeira opo. Mas no nibus, que nos levavam tanto pro hostel como pra alguns passeios, a guia falava tanto ingls como espanhol. Ah, em Guna Yala, apesar de a lngua do pas ser espanhol, eu j imaginava que teriam poucos latinos tbm, e assim foi."}),c.jsx("p",{children:"Tem muitas viagens que eu t super a fim de socializar, at esqueo a timidez, j outras que prefiro ficar mais na minha. Esses ltimos dias no Peru, fiquei mais sozinha mesmo. Mas isso no quer dizer que no curti, pelo contrrio, eu amei conhecer Paracas e Huacachina. No primeiro dia fiquei curtindo a praia e a noite teve uma banda de rock no prprio hostel, ento fiquei por l mesmo."}),c.jsx("p",{children:"O segundo dia fomos conhecer as Islas Ballescas e Parque Nacional de Paracas. Primeiro passeio foi de barco, vimos pinguins, lees-marinhos, coisas lindas!!! Como no estar feliz nesse lugar? Depois fomos pro deserto, paisagens lindas, paredes, praia vermelha. Algo que amei no Peru foram as paisagens, to diversas, ficava encantada, inclusive durantes os trajetos. Ah, no mesmo dia seguimos pra Huacachina e fizemos passeio de buggy nas dunas. Que dia! Descemos de snowboard nas dunas, teve uma delas que a altura me impressionou bastante. Ainda bem que sugeriram de eu trocar minhas havaianas por bota. Ia lascar meu p tentando frear esse trem! Hahaha. Ainda hoje tenho areia de Huacachina na minha bota rs"}),c.jsx("p",{children:"Acertei demais no hostel que escolhi em Huacachina. Eu conseguiria desconto em outro hostel muito bem recomendado. Mas sabe quando voc sente que tem que ir pra outro lugar? Segui minha intuio e fui feliz. O outro hostel era mais badaladinho mas eu no estava nessa vibe. E uma escolha de meses atrs foi a melhor  pro meu momento durante a viagem. Ele tinha um ambiente muito agradvel, uma piscina gracinha e uma vista maravilhosa pro osis. Amei."}),c.jsx("p",{children:"Vamos de diquinhas:"}),c.jsxs("ol",{children:[c.jsx("li",{children:"Perrengues acontecem mas mantenham a calma. Com certeza o fato do meu carto no ter funcionado de primeira me abalou a ponto de eu cair na conversa do taxista logo em seguida. No estava to despreparada assim pra me desesperar. Tinha dois cartes de dbito alm de uns dlares em espcie. E tbm carto de crdito que j estava habilitado pro exterior. V sempre com mais de uma opo."}),c.jsx("li",{children:"Ateno aos valores cobrados. No vi o valor cobrado no txi e confiei. Por muito pouco no sai com um grande prejuzo. Tirei foto do cara com sua suposta credencial, caso surgisse um valor cobrado posteriormente no meu carto. Em alguns lugares os valores cobrados por taxista  tabelado, se no for, combine o preo antes de entrar no carro. Mas, sempre que possvel, eu pego uber."}),c.jsx("li",{children:"Esses perrengues servem como aprendizado. No desanime, apesar do ocorrido em Lima, na Cidade do Panam eu sai do aeroporto sem internet e de txi. No ia desfalcar minha viagem se eu tivesse comprado o chip no aeroporto pra pedir meu uber, mas eu j estava vacinada. Fui de txi e ainda consegui desconto, mas dessa vez paguei com dinheiro"}),c.jsx("li",{children:"No crie barreiras que te impeam de viajar. A solitude  um caminho sem volta. Fui super animada pra Cusco com minha amiga e foi incrvel o que passamos juntas, mas eu estava com saudades de me aventurar sozinha, e esse foi um dos motivos pelo qual eu prolonguei minha viagem. Os guias que eu tive o prazer de conhecer nos ltimos dias da viagem foram muito especiais, ia embora com um aperto no corao. E sobre o idioma No, eu no falo espanhol. Mas me virei muito bem com o portunhol. Como conversei com algumas pessoas durante o planejamento da viagem fui aprendendo umas palavras que seriam bem teis, tipo desayuno, que  caf da manh. Mas de forma geral as palavras so bem semelhantes."}),c.jsx("li",{children:"E mais uma vez, faam seguro viagem. Principalmente se forem pra Cusco. Cada organismo reage de uma forma com a altitude, eu e minha amiga sentimos muito o soroche no primeiro dia. Se tiver tempo disponvel reserve o dia da chegada apenas pra descansar caso vo pra Cusco ou outra cidade de altitude elevada."})]}),c.jsx("footer",{children:c.jsx(at,{})})]})}const u1=Ce.div`
