`;function f1(){return c.jsxs(d1,{children:[c.jsx(ae,{img:am,alt:"foto do pr do sol em Morro de So Paulo mostrando tambm o mar com alguns barcos"}),c.jsx("h3",{children:"Morro de So Paulo, BA | 2022"}),c.jsx("p",{children:"No tem como esquecer a pandemia, n! Eu precisava viajar depois de anos em casa. Decidi viajar com minha me, dar de presente pra ns duas uma viagem pois merecamos depois de passar por tudo isso. Decidimos ir para Porto de Galinhas. Porm, apesar de eu adorar viajar com minha me, eu estava precisando de uma viagem solo tbm. Quem j viaja sozinha vai me entender. Eis ento que antes de viajar com mainha eu peguei cinco dias de frias e fui pra Morro de SP. H anos que eu tinha vontade de conhecer Morro, ouvi falar de l quando fiz minha primeira viagem sozinha para Itacar, na Bahia tbm."}),c.jsx("p",{children:"Mas a primeira vez que eu realmente tentei ir pra Morro eu estava em um relacionamento. E claro que o querido s colocou defeito e achou caro. Por fim, fomos pra Minas. No vou ser injusta, foi uma viagem boa, Minas no tem como ser ruim. Apesar da gente ter brigado em plena vspera de ano novo e ter ficado to caro quanto ficaria Morro mas por motivos de cachaa e no de voo, catamar e passeios de barco"}),c.jsx("p",{children:"Enfim, manas, dramin  essencial, hein! Muita gente passa mal no catamar, especialmente na volta. Pra mim na ida foi tranquilo e a volta eu fui de meio semi-terrestre. Mas assim, demora muuuuito. Foram 6hs de trajeto contra 2h30 que seriam de catamar."}),c.jsx("p",{children:"Primeira vez que escolhi pousada em uma viagem sozinha, estava na vibezinha de ficar de boas. Pousada  mais difcil de fazer amizade se comparado com hostel. E a pousada que escolhi foi na quarta praia, a penltima, ou seja, era bem afastada. Mas a quarta praia  pura tranquilidade e cheia de piscinas naturais com muuitos peixinhos. Apaixonei nesse lugar."}),c.jsx("p",{children:"O centrinho de Morro fica na segunda praia e boa parte das hospedagens tbm. De onde eu estava at l dava pra ir de boa andando durante o dia, na mar baixa. Mas  noite s conseguia ir com o transporte da pousada que  rstico mas gratuito, rs. De forma geral as pousadas das quarta e quinta praia oferecem esse transporte em horrios especficos durante o dia e a noite."}),c.jsx("p",{children:"Agora, bora de perrengue?! Primeira noite fui pro centrinho e comprei um crepe, caminhei um pouco enquanto comia e quando retornei pra comprar uma bebidinha, cad meu celular??? Ah, pronto, roubaram meu celular naquela muvuquinha, fodeu!!! Retornei pro restaurante que era o ponto de encontro pro transporte e falei com uma funcionria. Ela ligou pro meu celular, chamava mas ningum atendia. Ela disse que era muito raro ocorrerem roubos por l, que eu deveria falar com a moa do crepe. Retornei, a moa no estava mais l, s a barraquinha. Fui refazendo o caminho que fiz anteriormente, passei na muvuquinha e fui pra praia, vi o lixo que joguei a embalagem do crepe e vi algo refletindo a luz da lua por perto Meu celular! Uffa"}),c.jsx("p",{children:"Os outros dias foram s alegria e apesar de estar numa pousada distante fiz amizade com uma guria do Sul, nos conhecemos na praia. Fomos na tirolesa, que vista mais linda, o final dela  no mar!!!"}),c.jsxs("ol",{children:[c.jsx("li",{children:"Carol do futuro aqui pra trazer uma dica da minha irm, que foi pra Morro em sua primeira viagem sozinha!!! Na volta ela foi de catamar e ficou do lado de fora tomando um arzinho (e umas ondas na cara, rs). Foi tranquilo. Mas l dentro tinha muita gente vomitando!!! A volta  contra a correnteza, balana muito! Mas um dramin e ar fresco ajudam."}),c.jsx("li",{children:"Sua viagem, suas regras. Em uma das noites j estava trocada para sair e ir pra segunda praia, mas meu livro estava to delicioso que decidi permanecer na rede lendo e comendo amendoim (mesmo tendo restaurante na pousada). Isso  liberdade, manas. Voc decide o que fazer e est tudo bem!"}),c.jsx("li",{children:"No se desespere, perrengues acontecem. A lio que ficou com a perda temporria do meu celular foi: ateno a seus pertences; mantenha cpias de documentos e informaes importantes no email; pea ajuda, uma simples conversa salvou minha noite, minha viagem."}),c.jsx("li",{children:"Antes s do que mal acompanhada. Eu tenho certeza que eu me diverti muito mais sozinha do que se tivesse insistido uns anos atrs pra ir com meu ex. Se afaste de pessoas que pe defeito em tudo, independente de onde esteja. Sabe pq viajar sozinha  to incrvel? Geralmente encontramos pessoas que esto vibrando na mesma sintonia que ns. Tudo flui bem, a vibe bate! E se s quiser ficar sozinha, t tudo bem tbm. A solitude  maravilhosa, esteja bem consigo antes de procurar a felicidade em outra pessoa."}),c.jsx("li",{children:"Existem viagens e viagens. Voc pode gostar de viajar com amigos, com famlia, com companheira(o) e sozinha. Podem ser viagens completamente diferentes e ambas podem ser timas! No deixe de viajar, mas saiba o que vc quer, pense em vc tbm. Em 2022 eu estava toda ryca, hahah. Janeiro fui sozinha pra Morro na minha pousada isolada; Fevereiro viajei com minha me pra Porto de Galinhas, lembrando que eu que convidei minha me, eu queria sim viajar com ela; em abril fui pra STL com uma colega e vaarios amigos dela, fomos de trip; agosto fiz a rota das emoes e fiz do meu jeitinho as hospedagens j vislumbrando os momentos em que eu gostaria de conhecer mais pessoas (detalhei em outro tpico); e ainda fui pra Pouso da Cajaba sozinha de trip (tbm detalhei em outro tpico). Cada viagem com sua vibezinha diferente e todas maravilhosas!!!"})]}),c.jsx("footer",{children:c.jsx(at,{})})]})}const m1=Ce.div`
