`;function p1(){return c.jsxs(m1,{children:[c.jsx(ae,{img:om,alt:"foto da Carol Pascott dentro de um fervedouro de gua transparente e rodeado de vegetao no Jalapo"}),c.jsx("h3",{children:"Jalapo, TO | 2019"}),c.jsx("p",{children:"Jalapo  aquela viagem dos sonhos mas que no  to acessvel assim Fui pra l qdo eu ainda estava namorando, inclusive, quase terminamos por causa dessa viagem, hahah. Meu ex s estudava e a me dele estava h uns anos afastada do trabalho. Eles decidiram viajar em pleno feriado de julho sem necessidade j que  ambos tinham disponibilidade de viajar no meio da semana como geralmente faziam. Oh, nem perceberam que era feriado."}),c.jsx("p",{children:"Maior frio em SP, no sudeste inteiro. Muito frio mesmo. Entrei no site vou de trip e achei uma viagem pro Jalapo com tudo incluso. Opa, minha chance. Boy no gostou, no. As melhores viagens vc quer ir sozinha. Pois , tenho bom gosto e prazer em gastar minha grana com viagem. Mas ok, voltei no site e procurei outro lugar pra ir sozinha. S viagens pro Sudeste e Sul, lembra que falei que estava frio? Foda-se, eu vou pro Jalapo. Segundo ele, no era sobre eu viajar sozinha, mas sim o local. Afinal, ele vivia viajando sozinho pros congresso dele e eu no ia pq trabalhava."}),c.jsx("p",{children:"Mas, eu no ia ficar em casa sozinha em um feriado prolongado e gelado, fui pro Jalapo. Essa foi uma das decises mais acertadas da vida! Quando levei um p na bunda desse cara, em plena vspera da vspera de ano novo de 2020, foi uma das primeiras coisas de que me recordei. Ainda bem que no deixei de viver um sonho por causa dele."}),c.jsx("p",{children:"Ah, se vc leu sobre Morro de SP deve lembrar que mencionei sobre uma briga em um ano novo em MG. No foi esse ano que terminamos. Sim, ele tinha prazer em estragar datas comemorativas. Certas coisas so livramentos em nossas vidas!!!"}),c.jsx("p",{children:"Enfim, fechei essa viagem bem em cima da hora, como o voo estava incluso eu paguei bem caro. Jalapo foi a viagem mais cara que j fiz considerando o gasto total dividido pelos dias. Engraado como o boy vivia falando do valor que gastei nessa viagem, como se fosse ele que pagasse meu aluguel e minha cachaa Vocs acham que se eu tivesse desistido de ir sozinha ele iria pra l comigo? Com certeza no. E se fosse, iria reclamar o tempo todo."}),c.jsx("p",{children:"J adianto que o Jalapo no  pra qualquer um, no s pelo preo, mas pela viagem em si. Passamos muito tempo dentro do carro 4x4, muitas vezes apertado e quente.  tipo um circuito, ento trocamos de pousada todos os dias."}),c.jsx("p",{children:"Os fervedouros so as principais atraes,  algo nico na natureza. No sabe nadar? No tem problema, vc no vai afundar. As guas so muito limpas, cada fervedor tem suas caractersticas nicas. Maaas, pra manter preservada essa maravilha s  possvel ficar 20 minutos em cada fervedouro, no pode passar protetor solar antes de entrar, as regras so rgidas."}),c.jsx("p",{children:"Fui pro Jalapo principalmente por causa dos fervedouros, mas colega, vc no tem ideia da diversidade que este lugar reserva. A cachoeira mais linda que j fui na vida fica por l, Cachoeira da Formiga. Tbm tem dunas, Pedra Furada, Cnion do Sussuapara. No  um destino barato e muito menos para quem gosta de conforto, mas se vc curte natureza e diversidade, v! Vale cada centavo gasto."}),c.jsxs("ol",{children:[c.jsx("li",{children:"J falei algumas vezes que o Jalapo no  barato, n. Mas o que encareceu minha viagem foi o voo. Se eu tivesse comprado com antecedncia teria sado mais barato."}),c.jsx("li",{children:"Essa  uma viagem que  importante ir com agncia, pelo menos local. Os carros tem que ser 4x4, no h sinalizao na estrada. H vrias opes de pacotes tanto de agncias de SP, com ou sem voo, como agncias locais."}),c.jsx("li",{children:"Quer muito conhecer o Jalapo mas seus amigos, companheira(o) e/ou famlia so do tipo fresco? V sozinha."}),c.jsx("li",{children:"J falei que  caro, n? Maaas, normalmente todas as refeies e hospedagens esto inclusas no valor do pacote, alm do transporte e entrada nos passeios. Voc no vai gastar muito por l, s com bebidas e lembrancinhas se assim quiser. Ento  fcil de planejar e administrar seus gastos."}),c.jsx("li",{children:"Jalapo foi a primeira viagem que fiz com tantos cenrios diferentes. Eu amo isso e diria que tem sido meu tipo de viagem predileta. Mas  incrvel que l essa diversidade toda est bem perto uma da outra. Outros lugares que eu fui em busca de lugares diferentes em uma nica viagem foram: Rota das Emoes; Cusco, Paracas, Huacachina e Guna Yala; e Atacama e Salar de Uyuni."})]}),c.jsx("footer",{children:c.jsx(at,{})})]})}const h1=Ce.div`
